import React, { Component } from 'react';
import {
  Card, CardImg, CardText, CardBody,
  CardTitle, CardSubtitle,
  Button,
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem
} from 'reactstrap';
import Particles from 'react-particles-js';
import SkillBar from 'react-skillbars';
import logo from './imgs/Brand_Control.png'
import bg from './imgs/Binary.jpg'
import './App.css';
import 'bootstrap/dist/css/bootstrap.css';

const skills = [
  {
    "type": "Java",
    "level": 100,
    "color": {
      "bar": "#3498db",
      "title": {
        "text": "#fff",
        "background": "#2980b9"
      }
    }
  },
  {
    "type": "React",
    "level": 85,
    "color": {
      "bar": "#4288d0",
      "title": {
        "text": "#fff",
        "background": "#124e8c"
      }
    }
  },
  {
    "type": "Javascript",
    "level": 75,
    "color": {
      "bar": "#2c3e50",
      "title": {
        "text": "#fff",
        "background": "#2c3e50"
      }
    }
  },
  {
    "type": "Spring",
    "level": 50,
    "color": {
      "bar": "#5a68a5",
      "title": {
        "text": "#fff",
        "background": "#46465e"
      }
    }
  },
  {
    "type": "Docker",
    "level": 25,
    "color": {
      "bar": "#525252",
      "title": {
        "text": "#fff",
        "background": "#333333"
      }
    }
  },
  {
    "type": "HTML",
    "level": 20,
    "color": {
      "bar": "black",
      "title": {
        "text": "#111",
        "background": "#fff"
      }
    }
  },
  {
    "type": "NoSQL",
    "level": 0,
    "color": {
      "bar": "#2ecc71",
      "title": {
        "text": "#fff",
        "background": "#27ae60"
      }
    }
  }
]

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
    };
  }
  render() {
    return (
      <div className="container-fluid" style={{padding: "0px"}}>
        <Navbar color="light" light expand="md">
          <NavbarBrand href="/">Clay Palumbo</NavbarBrand>
          <NavbarToggler onClick={this.toggle} />
          <Collapse isOpen={this.state.isOpen} navbar>
            <Nav className="ml-auto" navbar>
              <NavItem>
                <NavLink href="#">About</NavLink>
              </NavItem>
              <NavItem>
                <NavLink href="#">Applications</NavLink>
              </NavItem>
              <UncontrolledDropdown nav inNavbar>
                <DropdownToggle nav caret>
                  Social Pages
                </DropdownToggle>
                <DropdownMenu right>
                  <DropdownItem>
                    Github
                  </DropdownItem>
                  <DropdownItem>
                    LinkedIn
                  </DropdownItem>
                </DropdownMenu>
              </UncontrolledDropdown>
            </Nav>
          </Collapse>
        </Navbar>
        <div className="App" >
          <Particles
            params={{
              "particles": {
                "number": {
                  "value": 50
                },
                "size": {
                  "value": 3
                },
              },
              "color": {
                "value": "#CCC"
            },
              "interactivity": {
                "events": {
                  "onhover": {
                    "enable": true,
                    "mode": "repulse"
                  },
                  "onclick": {
                    "enable": true,
                    "mode": "push"
                }
                }
              }
            }} 
            style={{
              width: '100%',
              backgroundImage: `url(${bg})` 
            }}
            />
          <div className="row" style={{margin: "20px"}}>
          <Card className="col-4" style={{margin: "20px"}}>
            <CardImg top width="10%" src={logo}alt="Card image cap" />
            <CardBody>
              <CardTitle>Card title</CardTitle>
              <CardSubtitle>Card subtitle</CardSubtitle>
              <CardText>Some quick example text to build on the card title and make up the bulk of the card's content.</CardText>
              <Button>Button</Button>
            </CardBody>
          </Card>
          <Card className="col-4" style={{margin: "20px"}}>
            <CardImg top width="10%" src={logo}alt="Card image cap" />
            <CardBody>
              <CardTitle>Card title</CardTitle>
              <CardSubtitle>Card subtitle</CardSubtitle>
              <CardText>Some quick example text to build on the card title and make up the bulk of the card's content.</CardText>
              <Button>Button</Button>
            </CardBody>
          </Card>
          <Card className="col-4" style={{margin: "20px"}}>
            <CardImg top width="10%" src={logo}alt="Card image cap" />
            <CardBody>
              <CardTitle>Card title</CardTitle>
              <CardSubtitle>Card subtitle</CardSubtitle>
              <CardText>Some quick example text to build on the card title and make up the bulk of the card's content.</CardText>
              <Button>Button</Button>
            </CardBody>
          </Card>
          </div>
          <SkillBar skills={skills} animationDelay={0} />

        </div>
      </div>
    );
  }
}


export default App;
